script: |
  super -f text -I q3601.spq | sort > q3601.out

inputs:
  - name: q3601.spq
    data: |
      SELECT - ( 6 ) * col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + 59 NOT IN ( + + 49 * - col2 + - 6, 87, - + col1 * + col2 + col2 + - ( 71 ) );
  - name: tab0

outputs:
  - name: q3601.out
    data: |
      -282
      -594
      -60
